import "./header.scss";
import * as Icons from "../icons/index";
import Logo from "./Logo";

function Header() {
  return (
    <header>
      <div className="container">
        <div className="container-inner">
          <div className="header-left">
            
            <nav>
            <div className="logo">
              <Logo />
            </div>
              <ul>
                <li>
                  <a href="/">ANASAYFA</a>{" "}
                </li>
                <li>
                  <a href="/">DERSLER</a>{" "}
                </li>
                <li>
                  <a href="/">HAKKIMIZDA</a>{" "}
                </li>
                <li>
                  <a href="/">İLETİŞİM</a>{" "}
                </li>
              </ul>
            </nav>
          </div>
          <div className="header-right">
            asdfas
            <Icons.Profile />
          </div>
        </div>
      </div>
    </header>
  );
}

export default Header;
